import { useState, useEffect, useCallback } from "react";
import { db } from "../firebase";
import { getAuth, signOut } from "firebase/auth"; // Import signOut
import { collection, query, where, getDocs, doc, getDoc } from "firebase/firestore";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const Dashboard = () => {
  const [classes, setClasses] = useState([]);
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  const fetchClasses = useCallback(async () => {
    const auth = getAuth();
    if (!auth.currentUser) return;

    const q = query(collection(db, "classroom"), where("owner", "==", auth.currentUser.uid));
    const querySnapshot = await getDocs(q);
    setClasses(querySnapshot.docs.map((doc) => ({ id: doc.id, ...doc.data() })));
  }, []);

  useEffect(() => {
    const fetchData = async () => {
      const auth = getAuth();
      if (!auth.currentUser) {
        navigate("/");
        return;
      }

      const userDocRef = doc(db, "users", auth.currentUser.uid);
      const docSnap = await getDoc(userDocRef);

      if (docSnap.exists()) {
        setUser(docSnap.data());
      } else {
        console.error("User not found in Firestore");
        navigate("/");
      }
    };

    fetchData();
    fetchClasses();
  }, [fetchClasses, navigate]);


  const handleLogout = async () => {
    const auth = getAuth();
    try {
      await signOut(auth);
      navigate("/");
    } catch (error) {
      console.error("Logout failed:", error);
    }
  };


  return (
    <div className="dashboard-container">
      <div className="dashboard-content">
        <div className="dashboard-header">
          <h1 className="dashboard-title">📚 Dashboard</h1>
          <button onClick={handleLogout} className="logout-button">
            ออกจากระบบ
          </button>
        </div>

        {user && (
          <div className="user-info">
            <img
              src={user.photo || "default-profile-pic.jpg"} // Provide a default image path
              alt="User Profile"
              className="user-profile-pic"
            />
            <div className="user-details">
              <h4 className="user-name">{user.name}</h4>
              <p className="user-email">{user.email}</p>
            </div>
          </div>
        )}

        <div className="button-group">
          <button
            onClick={() => navigate("/edit-profile")}
            className="edit-profile-button"
          >
            ✏️ แก้ไขโปรไฟล์
          </button>
          <button
            onClick={() => navigate("/add-class")}
            className="add-class-button"
          >
            ➕ เพิ่มห้องเรียน
          </button>
        </div>

        <div className="class-list">
          {classes.length > 0 ? (
            classes.map((cls) => (
              <div key={cls.id} className="class-card">
                {cls.info.photo && (
                  <img
                    src={cls.info.photo}
                    alt="Class"
                    className="class-image"
                  />
                )}
                <div className="class-details">
                  <h5 className="class-title">
                    {cls.info.code} - {cls.info.name}
                  </h5>
                  <p className="class-room">📍 ห้องเรียน: {cls.info.room}</p>
                  <button
                    onClick={() => navigate(`/manage-class/${cls.id}`)}
                    className="manage-class-button"
                  >
                    จัดการห้องเรียน
                  </button>
                </div>
              </div>
            ))
          ) : (
            <p className="no-classes">📌 ยังไม่มีห้องเรียน</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
